      SELECT DISTINCT 20 * COUNT ( * ) col1 FROM tab1 (FORMAT parquet) AS cor0 CROSS JOIN tab2 (FORMAT parquet) AS cor1 WHERE NOT - 11 IS NULL;
  - name: tab1
  - name: tab2

outputs:
